import React from 'react';

function Step({ step, setStep }) {
  const handleStepChange = (e) => {
    const newStep = parseInt(e.target.value);
    setStep(newStep >= 1 ? newStep : 1);
  };

  return (
    <div>
      <label>
        Krok: <input type="number" value={step} onChange={handleStepChange} />
      </label>
    </div>
  );
}

export default Step;
